	add("hetaera", "{\"term\":\"hetaera\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027ἑταῖρα\u0027 () feminine of \u0027ἑταῖρος\u0027 (companion)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A mistress, especially a highly cultivated courtesan in ancient Greece\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1957\u0027\u0027, Lawrence Durrell, \u0027Justine\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"But of course our friend is only a shallow twentieth-century reproduction of the great \u0027\u0027\u0027hetairae\u0027\u0027\u0027 of the past, the type to which she belongs without knowing it, Lais, Charis and the rest\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1971\u0027\u0027, Gottfried Benn \u0026amp; E. B. Ashton, \u0027Primal vision: selected writings‎\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Woman is dethroned as the primary and supreme sex, debased into inseminable \u0027\u0027hetaera\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1980\u0027\u0027, Anthony Burgess, \u0027Earthly Powers\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Christ appeared, only to reveal himself as the naked god Pan. Ballet of \u0027\u0027hetaerae\u0027\u0027 and houris, choreography by Italo Castaldi\", \"priority\":7}]}, \"synonyms\":{}}");

