	add("heterosociality", "{\"term\":\"heterosociality\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|hetero|sociality|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Socialization (social interaction, social relationships) with members of the opposite sex, as distinguished from sexual interaction with or attraction to members of the opposite sex (heterosexuality) and social interaction with members of the same sex (homosociality\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Barrie Gunter, \u0027Media Sex: What are the Issues?\u0027 (ISBN 0805837221), page 67\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Gagnon (1990; Gagnon \u0026amp; Simon, 1973) proposed important and relevant differences in sexual scripts stemming from women\u0027s socialisation into \u0027\u0027heterosociality\u0027\u0027 before heterosexuality, in contrast to men\u0027s socialisation into masturbation and heterosexuality before \u0027\u0027heterosociality\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, Chris Mounsey, \u0027Developments in the Histories of Sexualities\u0027 (ISBN 1611485010), page 245\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Potkay is noticing much the same thing, I suspect, when he opposes the polite \u0027\u0027heterosociality\u0027\u0027 of eighteenth-century conversation\", \"priority\":5}]}, \"synonyms\":{}}");

