	add("heterotopy", "{\"term\":\"heterotopy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"{{prefix|hetero|lang\u003den}} Ancient greek (to 1453) \u0027τόπος\u0027 (place) {{suffix||y|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A deviation from the natural position; abnormal placement\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A deviation from the natural position of parts, supposed to take place over thousands of years by the gradual displacement of germ cells\", \"priority\":2}]}, \"synonyms\":{}}");

